import logo from './logo.svg';
import './App.css';
import Navbar from "./components/Navbar";
import Blog from './routes/blog';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route/> 
      </Routes>
     <Navbar/>
     <Blog/>
    </div>
  );
}

export default App;
